import styled from "styled-components";
import Theme from "../../theme";


const ArtistListCont = styled.section `
    background-color: ${props => props.theme.colors.seconddary};
    margin: 2%;
    overflow: hidden;
    padding: 0;
    border-radius: 15px;
`


export {
    ArtistListCont,
}
